import React, { useState } from "react";
import api from "../service/api";

const AtivoForm = () => {
    const [formData, setFormData] = useState({
        nome: "",
        codigo_patrimonio: "",
        categoria: "Notebook",
        localidade: "",
        setor: "",
        responsavel: "",
        status: "Ativo",
        data_ultima_avaliacao: "",
        data_proxima_avaliacao: "",
        modelo: "",
        marca: "",
        numero_serie: "",
        mac_address_ethernet: "",
        mac_address_wifi: "",
        ip_fixado: "",
        bitlocker: false,
        antivirus_licenca: "",
        antivirus_versao: "",
        bart_wazuh: false,
        chrome_enterprise: false,
        acesso_remoto_id: "",
        termo_custodia: false,
    });

    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;
        setFormData({
            ...formData,
            [name]: type === "checkbox" ? checked : value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        api.post("ativos/", formData)
            .then((response) => {
                alert("Ativo adicionado com sucesso!");
                setFormData({
                    nome: "",
                    codigo_patrimonio: "",
                    categoria: "Notebook",
                    localidade: "",
                    setor: "",
                    responsavel: "",
                    status: "Ativo",
                    data_ultima_avaliacao: "",
                    data_proxima_avaliacao: "",
                    modelo: "",
                    marca: "",
                    numero_serie: "",
                    mac_address_ethernet: "",
                    mac_address_wifi: "",
                    ip_fixado: "",
                    bitlocker: false,
                    antivirus_licenca: "",
                    antivirus_versao: "",
                    bart_wazuh: false,
                    chrome_enterprise: false,
                    acesso_remoto_id: "",
                    termo_custodia: false,
                });
            })
            .catch((error) => {
                console.error("Erro ao adicionar ativo:", error);
                alert("Erro ao adicionar ativo. Verifique os dados.");
            });
    };

    return (
        <div className="container mt-4">
            <h2>Adicionar Ativo</h2>
            <form onSubmit={handleSubmit}>
                <div className="mb-3">
                    <label className="form-label">Nome</label>
                    <input
                        type="text"
                        className="form-control"
                        name="nome"
                        value={formData.nome}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label className="form-label">Código de Patrimônio</label>
                    <input
                        type="text"
                        className="form-control"
                        name="codigo_patrimonio"
                        value={formData.codigo_patrimonio}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label className="form-label">Categoria</label>
                    <select
                        className="form-select"
                        name="categoria"
                        value={formData.categoria}
                        onChange={handleChange}
                    >
                        <option value="Notebook">Notebook</option>
                        <option value="Desktop">Desktop</option>
                    </select>
                </div>
                <div className="mb-3">
                    <label className="form-label">Localidade</label>
                    <input
                        type="text"
                        className="form-control"
                        name="localidade"
                        value={formData.localidade}
                        onChange={handleChange}
                    />
                </div>
                <div className="mb-3">
                    <label className="form-label">Setor</label>
                    <input
                        type="text"
                        className="form-control"
                        name="setor"
                        value={formData.setor}
                        onChange={handleChange}
                    />
                </div>
                <div className="mb-3">
                    <label className="form-label">Responsável</label>
                    <input
                        type="text"
                        className="form-control"
                        name="responsavel"
                        value={formData.responsavel}
                        onChange={handleChange}
                    />
                </div>
                <div className="mb-3">
                    <label className="form-label">Status</label>
                    <select
                        className="form-select"
                        name="status"
                        value={formData.status}
                        onChange={handleChange}
                    >
                        <option value="Ativo">Ativo</option>
                        <option value="Inativo">Inativo</option>
                    </select>
                </div>
                {/* Outros campos podem ser adicionados aqui da mesma forma */}
                <button type="submit" className="btn btn-primary">
                    Adicionar Ativo
                </button>
            </form>
        </div>
    );
};

export default AtivoForm;
